import http from "../http-users";

class userDataService{
  getUsers(){
    return http.get(`users`,{mode:'no-cors'});
  }

  async getUser(userId){
    return await http.get(`/users/${userId}`,{mode:'no-cors'});
  }
}

export default new userDataService();
